import React from 'react';
import Container from 'react-bootstrap/Container';

function ContactForm() {
    return (
        <Container fluid={true}>
            <form>
                <input type="text" placeholder="Full Name" />
            </form>
        </Container>
    );
}

export default ContactForm;
